import React, { useState, useEffect } from "react";
import axios from "axios";
import Back from "../common/back/Back";

const Notification = () => {
  const [productData, setProductData] = useState([]);
  const navigate = () => {
    window.location.href = "/roadmap";
  };

  useEffect(() => {
    const fetchProductData = async () => {
      try {
        const response = await axios.get("http://localhost:8000/api/roadmap");
        setProductData(response.data);
      } catch (error) {
        console.error("Error fetching product data:", error);
      }
    };

    fetchProductData();
  }, []);

  return (
    <div className="bg-gray-100 min-h-auto py-8 px-4">
      <Back title="News Posts" />
      <div className="max-w-lg mx-auto bg-white rounded-lg shadow-md p-6 mt-2">
        <h2 className="text-2xl font-semibold mb-4">Notifications</h2>
        <div className="notification-container">
          <div className="notification-item flex justify-between items-center border-b border-gray-300 py-4">
            <span className="notification-text text-gray-800">
              Notification content goes here
            </span>
            <span className="notification-time text-gray-500">12:30 PM</span>
          </div>
        </div>
      </div>
    </div>
  );
};

export default Notification;
